import React from 'react';

function CarItem({ car }) {
    return (
        <div className="car-item">
            <h3>{car.id}</h3>
            <p>An fabricație: {car.releaseDate}</p>
            <p>Preț: {car.price} €</p>
            <p>{car.model}</p>
        </div>
    );
}

export default CarItem;
